import "core-js/modules/es.array.push.js";
import OffersList from "./Components/OffersList/OffersList.vue";
import Chart from "./Components/Chart/Chart.vue";
export default {
  components: {
    OffersList,
    Chart
  },
  computed: {
    getSelectedItem() {
      return this.$store.getters["marketPlace/getSelectedItem"];
    },
    getIsFocusExchangeOffers() {
      return this.$store.getters["marketPlace/getIsFocusExchangeOffers"];
    },
    getOffers() {
      if (this.getSelectedItem.data?.buyInfo) {
        const myOffers = [];
        if (this.getIsFocusExchangeOffers) {
          this.getSelectedItem.data.buyInfo.forEach(offer => {
            if (offer.static === this.getStatic) {
              myOffers.push(offer);
            }
          });
          return myOffers;
        } else {
          return this.getSelectedItem.data.buyInfo;
        }
      } else {
        return [];
      }
    },
    getStatic() {
      return this.$store.getters["playerMenu/getStatic"];
    }
  },
  methods: {
    unfocusMyOffers() {
      this.$store.commit("marketPlace/switchFocusExchangeOffers");
    }
  }
};
